import tw from "tailwind-styled-components"

const Greeting = tw.h1`
${(p) => (p.$primary ? "bg-indigo-600" : "bg-indigo-300")}



text-xs
font-medium

shadow-sm
text-blue-200

hover:bg-indigo-700
focus:outline-none`

export default function App() {
  return (
    <Greeting>
      Hello world!
    </Greeting>
  )
}
